description:
Font Awesome MVC is a HTML extension that wraps the popular Font Awesome project into friendly Razor syntax.

To start using the extension methods you'll need to include the namespace 'ShutterPrism.MVC.FontAwesome' in your web.config file. Then you will have access to the to create Font Awesome icons using the helper methods.

@Html.FontAwesome().Icon(FontAwesome.FontAwesomeIcons.CameraRetro)

Preconfigured Items:
• The App_Data folder with updated path to dataFolder variable;
• Sitecore settings for scaled environment.

Features:
• Grand permission in the file system on a WebRole Instance;
• Rebuild Search Indexes on very first start of a WebRole Instance.

Smart internationalization for .NET web apps;
    Globally recognized interface; localize like the big kids;
    Localizes everything; controller calls, views, validation attributes, and routes.
